    <>
      <div className="sidebar">
      <Link to="/phone" className="nav-link"> Telefon</Link>
      <Link to="/pc" className="nav-link"> Számítógép</Link>
      <Link to="/headphones" className="nav-link"> Fülhallgató</Link>
      <Link to="/hardver" className="nav-link"> Hardver</Link>
      <Link to="/tv" className="nav-link"> TV</Link>
      </div>

    </>
  );
}
